            @par Value range:
            	    [0,0x7fffffff]
            @par Default value:
            	    3

The max count of frames waiting results(text result/localization result) will be kept for further reference.

            @par Value range:
            	    [0, 0x7fffffff]
            @par Default value:
            	    10

The width of the frame image in pixels.

            @par Value range:
            	    [0, 0x7fffffff]
            @par Default value:
            	    0

The height of the frame image in pixels.

            @par Value range:
            	    [0, 0x7fffffff]
            @par Default value:
            	    0

The stride of the frame image(alse called scan width).

            @par Value range:
            	    [0,0x7fffffff]
            @par Default value:
            	    0

The image pixel format used int the image byte array.

            @par Value range:
            	    A value of ImagePixelFormat Enumeration items
            @par Default value:
            	    IPF_GRAYSCALED
            @sa Dynamsoft.DBR.EnumImagePixelFormat

The region definition of the frame to calculate the internal indicator.

            @par Default Value:
           		{
           			regionLeft = 0,
           			regionRight = 0,
           			regionTop = 1,
           			regionBottom = 1,
           			regionMeasuredByPercentage = 1
           		}
            @sa Dynamsoft.DBR.RegionDefinition

The threshold used for filtering frames.

            @par Value range:
            	    [0, 1]
            @par Default value:
            	    0.1
            @par Remarks:
           	      The SDK will calculate an inner indicator for each frame from AppendFrame, if the change rate of the indicators
           		between current frame and the history frames is larger than the given threshold, the current frame will not be added to the inner frame queue waiting for decoding.

The frequency of calling method AppendFrame per second.

            @par Value range:
            	    [0,0x7fffffff]
            @par Default value:
            	    0
            @par Remarks:
           	      0 means the frequency will be calculated automatically by the SDK.

Sets whether to filter frames automatically.

            @par Value range:
            	    [0,1]
            @par Default value:
            	    1
            @par Remarks:
           	      0: Disable filtering frames automatically.
                  1: Enable filtering frames automatically.

Sets the method used for calculating the clarity of the frames.

            @par Value range:
            	    A value of ClarityCalculationMethod Enumeration items
            @par Default value:
            	    ECCM_CONTRAST
            @sa Dynamsoft.DBR.EnumClarityCalculationMethod

Sets the mode used for filtering frames by calculated clarity.

            @par Value range:
            	    A value of ClarityFilterMode Enumeration items
            @par Default value:
            	    CFM_GENERAL
            @sa Dynamsoft.DBR.EnumClarityFilterMode

Set the time period used to ignore duplicate results found in frames. Measured in ms.

            @par Value range:
            	    [0, 600000]
            @par Default value:
            	    3000

Set the orientation of the frame image data. 
            The value is the angle that the image needs to be rotated clockwise so it shows correctly on the display in its natural orientation. It can be 0, 90, 180, or 270.

            @par Value range:
            	    0, 90, 180, or 270
            @par Default value:
            	    0

The confidence coefficients for lines.
           There are 4 coefficients in this set:  
           LinesConfidenceCoefficients[0] is average positive amplitude;  
           LinesConfidenceCoefficients[1] is max positive amplitude;  
           LinesConfidenceCoefficients[2] is average negative amplitude;  
           LinesConfidenceCoefficients[3] is max negative amplitude.

Sets the phase where the algorithm stops.

           @par Value range:
                   Any one of the TerminatePhase Enumeration items
           @par Default value:
                   TP_BARCODE_RECOGNIZED
           @par Remarks:
                   When the recognition result is not desired, this parameter can be set to skip certain processing stages.
           @sa Dynamsoft.DBR.EnumTerminatePhase

Sets the maximum amount of time (in milliseconds) that should be spent searching for a barcode per page. It does not include the time taken to load/decode an image (Tiff, PNG, etc) from disk into memory.

            @par Value range:
            	    [0, 0x7fffffff]
            @par Default value:
            	    10000
            @par Remarks:
           	    If you want to stop reading barcodes after a specified amount of time, you can use this parameter to set a timeout.

Sets the number of threads the image processing algorithm will use to decode barcodes.

            @par Value range:
            	    [1, 4]
            @par Default value:
            	    4
            @par Remarks:
           	    By default, the library concurrently runs four different threads for decoding barcodes in order to keep a balance between speed and quality. For some devices (e.g. Raspberry Pi) that only use one core, you can set it to 1 for best speed. If you create BarcodeReader.

Sets the formats of the barcode in BarcodeFormat group 1 to be read. Barcode formats in BarcodeFormat group 1 can be combined.

            @par Value range:
            	    A combined value of EnumBarcodeFormat Enumeration items
            @par Default value:
            	    BF_ALL
            @par Remarks:
           	     If you already know the barcode type(s) before performing barcode reading, specifying the barcode type(s) to be read will speed up the recognition process.
           	     The barcode format our library will search for is composed of [BarcodeFormat group 1](@ref Dynamsoft.DBR.EnumBarcodeFormat) and [BarcodeFormat group 2](@ref Dynamsoft.DBR.EnumBarcodeFormat_2), so you need to specify the barcode format in group 1 and group 2 individually.
            @sa Dynamsoft.DBR.EnumBarcodeFormat, Dynamsoft.DBR.EnumBarcodeFormat_2

Sets the formats of the barcode in BarcodeFormat group 2 to be read. Barcode formats in BarcodeFormat group 2 can be combined.

            @par Value range:
            	    A combined value of EnumBarcodeFormat_2 Enumeration items
            @par Default value:
            	    BF2_NULL
            @par Remarks:
           	     If you already know the barcode type(s) before performing barcode reading, specifying the barcode type(s) to be read will speed up the recognition process.
           	     The barcode format our library will search for is composed of [BarcodeFormat group 1](@ref Dynamsoft.DBR.EnumBarcodeFormat) and [BarcodeFormat group 2](@ref Dynamsoft.DBR.EnumBarcodeFormat_2), so you need to specify the barcode format in group 1 and group 2 individually.
            @sa Dynamsoft.DBR.EnumBarcodeFormat, Dynamsoft.DBR.EnumBarcodeFormat_2

Sets the output image resolution.

            @par Value range:
            	    [100, 600]
            @par Default value:
            	    300
            @par Remarks:
           	     When you are trying to decode a PDF file using DecodeFile method, the library will convert the pdf file to image(s) first, then perform barcode recognition.

Sets the threshold for the image shrinking.

            @par Value range:
            	    [8, 0x7fffffff]
            @par Default value:
            	    2300
            @par Remarks:
           	     If the shorter edge size is larger than the given value, the library will calculate the required height and width of the barcode image and shrink the image to that size before localization. Otherwise, it will perform barcode localization on the original image.

Sets the mode and priority for binarization.

            @par Value range:
            	    Each array item can be any one of the BinarizationMode Enumeration items.
            @par Default value:
            	    [BM_LOCAL_BLOCK,BM_SKIP,BM_SKIP,BM_SKIP,BM_SKIP,BM_SKIP,BM_SKIP,BM_SKIP]
            @par Remarks:
           	     The array index represents the priority of the item. The smaller index is, the higher priority is.
           	@sa  Dynamsoft.DBR.EnumBinarizationMode

Sets the mode and priority for localization algorithms.

            @par Value range:
            	    Each array item can be any one of the LocalizationMode Enumeration items.
            @par Default value:
            	    [LM_CONNECTED_BLOCKS,LM_SCAN_DIRECTLY,LM_STATISTICS,LM_LINES,LM_SKIP,LM_SKIP,LM_SKIP,LM_SKIP]
            @par Remarks:
           	     The array index represents the priority of the item. The smaller index is, the higher priority is.
            @sa  Dynamsoft.DBR.EnumLocalizationMode

Sets the degree of blurriness of the barcode. DeblurLevel is deprecated. It still works in this version but could be removed at some point in the future. It is recommended to use DeblurModes instead.

            @par Value range:
            	    [0, 9]
            @par Default value:
            	    9
            @par Remarks:
           	     If you have a blurry image, you can set this property to a larger value. The higher value set, the more effort the library will spend to decode images, but it may also slow down the recognition process.

Sets which types of intermediate result to be kept for further reference. Intermediate result types can be combined.

            @par Value range:
            	     A combined value of IntermediateResultType Enumeration items
            @par Default value:
            	    0
            @sa Dynamsoft.DBR.EnumIntermediateResultType

